Step-by-step reasoning:
1. Key Psychological Mechanisms: The responder likely evaluates the proposal by comparing the offered share (split_self) to a dynamically learned fair share expectation. This fairness expectation is inferred from one’s own relative contribution via token_self (as opposed to token_opp) and the total available money (combined_earning). The extent to which a deviation between the offered share and the fair share affects acceptance is modulated by an individual sensitivity parameter.
2. Interaction of Mechanisms: In each trial, the responder computes a fairness benchmark as the proportional contribution (token_self/(token_self+token_opp)) multiplied by the total combined earnings. A learnable adjustment (fairness weight) scales this computed fair share to capture any deviation from the “ideal” model of fairness. The decision to accept is then a function of how much the offered share (split_self) exceeds or falls short of this fairness expectation, with an intercept and sensitivity determining the likelihood.
3. Mathematical Form: A logistic specification is employed because we predict a continuous value between 0 and 1 (even though the actual accept is binary, the prediction is a continuous probability used in an MSE objective). The linear predictor is the sum of an intercept and a sensitivity-modulated difference between the offered share and the scaled fairness expectation.
4. Learnable Parameters: 
  • theta0 (θ₀): Intercept for baseline acceptance tendency.
  • theta1 (θ₁): Sensitivity to the deviation from fairness expectation.
  • theta2 (θ₂): Fairness expectation weight that scales the computed fair share from contributions.
5. Mapping to Observable Behavior: For each trial, the calculated fair share is (token_self/(token_self+token_opp)) multiplied by combined_earning; its scaled form by theta2 is subtracted from the offered share (split_self) (and modulated by theta1 plus an intercept) to yield a decision utility. The logistic transformation of this utility predicts the probability of accept. This predicted probability is then compared via mean squared error to the observed accept value.

Below is the formal specification.

