def simulate_model(trial_data, theta0=0, theta1=1, theta2=1):
    model_predictions = []
    for trial in trial_data:
        split_self = trial.get("split_self", 0)
        token_self = trial.get("token_self", 0)
        token_opp = trial.get("token_opp", 0)
        combined_earning = trial.get("combined_earning", 0)

        if (token_self + token_opp) == 0:
            fairness_component = 0  # Avoid division by zero
        else:
            fairness_component = theta2 * (token_self / (token_self + token_opp)) * combined_earning

        utility = theta0 + theta1 * (split_self - fairness_component)

        try:
            p_accept = 1 / (1 + math.exp(-utility))
        except OverflowError:
            p_accept = 0.0 if utility < 0 else 1.0  # Handle potential overflow

        model_predictions.append(p_accept)
    return model_predictions
